import React from "react";
import ReactDOM from "react-dom";
import App from "components/App";
import {HashRouter, Route} from "react-router-dom";

ReactDOM.render(
    <HashRouter>
        <Route path='/' component={App}/>
    </HashRouter>,
    document.getElementById('app')
);
